-- Création de la base de données si elle n'existe pas
CREATE DATABASE IF NOT EXISTS delivery_db;

-- Création de l'utilisateur kata_user s'il n'existe pas
CREATE USER IF NOT EXISTS 'kata_user'@'%' IDENTIFIED WITH mysql_native_password BY 'kata_password';

-- Affectation des droits à l'utilisateur sur delivery_db

GRANT ALL PRIVILEGES ON delivery_db.* TO 'kata_user'@'%';
FLUSH PRIVILEGES;


-- Utilisation de la base de données
USE delivery_db;

-- Création de la table time_slots si elle n'existe pas
CREATE TABLE IF NOT EXISTS time_slots (
    id BIGINT AUTO_INCREMENT PRIMARY KEY,
    delivery_mode VARCHAR(255),
    start_time TIMESTAMP,
    end_time TIMESTAMP
);

-- Création de la table orders si elle n'existe pas
CREATE TABLE IF NOT EXISTS orders (
    id BIGINT AUTO_INCREMENT PRIMARY KEY,
    customer_id VARCHAR(255),
    time_slot_id BIGINT,
    FOREIGN KEY (time_slot_id) REFERENCES time_slots(id)
);

-- Truncate des tables
DELETE FROM time_slots;
DELETE FROM orders;

